C# - MongoDB how to remove an item from multiple nested arrays by element value?<p>I have this JSON structure in a mongo db collection:</p>

<pre><code>{
    "Id":"123",
    "Product": "test",
    "Tags":[
        {
            "Name": "name",
            "Categories": [
                {
                    "Name": "test",
                    "OtherValue": ...
                }
            ]
        },
        {
            "Name": "name",
            "Categories": [
                {
                    "Name": "test",
                    "OtherValue": ...
                }
            ]
        }
    ]
}
</code></pre>

<p>Is there a way to be able to remove an item from all of the nested "Categories" arrays by the item's <code>"Name"</code> property?</p>

<p>For example, remove all categories where <code>"Name" == "test"</code>?</p>

<p>I tried something like this:</p>

<pre><code>var filter = Builders&lt;Item&gt;.Filter.Eq(item =&gt; item.Id, "123");
var update = Builders&lt;Item&gt;.Update.Pull("Tags.$[].Categories[i]", "test");

var arrayFilters = new List&lt;ArrayFilterDefinition&gt;
{
    new JsonArrayFilterDefinition&lt;Setup&gt;("{\"i.Name\": \"test\"}")
};

var updateOptions = new UpdateOptions { ArrayFilters = arrayFilters };
await Collection.UpdateOneAsync(filter, update, updateOptions);
</code></pre>

<p>But it didn't work...
Any ideas?</p>

