Differentiated Login Response Based on Database Field: Express + Node + MongoDB<p>I have a website with a tutorial page. Before a user can access deeper parts of the website, they must first have read the tutorial. In my mongo database I have set a field to check this as such:</p>

<pre><code>const UserSchema = new Schema({

    finished_beta_tutorial: {
        type: Boolean,
        default: false
    },
    ....
</code></pre>

<p>When the user attempts to login, I want to send them to the Tutorial page if <code>finished_beta_tutorial</code> is false. And if they have seen it (where the field is <code>true</code>), I want to send them to some other page in the website. </p>

